import React from 'react';
import { Form, InputGroup } from 'react-bootstrap';

const SearchBar = ({ searchQuery, setSearchQuery }) => {
  return (
    <InputGroup className="search-bar-container w-50 ms-0 position-relative">
      <Form.Control
        type="text"
        placeholder="Strains, brands, products..."
        className="form-control rounded-pill"
        value={searchQuery}
        onChange={(e) => setSearchQuery(e.target.value)}
        style={{
          fontSize: '14px',
          backgroundColor: '#2D2D2D',
          border: '1px solid #3D3D3D',
          color: '#FFFFFF'
        }}
      />
      <span
        className="position-absolute top-50 start-0 translate-middle-y ps-3 search-icon"
        style={{ fontSize: '14px', color: '#888888', zIndex: 5 }}
      >
        <i className="bi bi-search"></i>
      </span>
    </InputGroup>
  );
};

export default SearchBar;
